import Topbar from "./topbar";
import LogoIcon from "../../icons/logo";

function Header() {
  const design = {
    container: "border",
  };
  const position = {
    container: "flex justify-between px-5 py-2",
  };

  return (
    <>
      <Topbar />
      <div className={`${design.container} ${position.container}`}>
        <LogoIcon />
      </div>
    </>
  );
}

export default Header;
